ontain: one or more people, tree, sky, outdoor and nature"}},{"node":{"__typename":"GraphSidecar","id":"2074915554384303300","edge_media_to_caption":{"edges":[{"node":{"text":"Photo 4: Jay is also the one who introduced me to hiking. I remember thinking, \u201cWhy am I wearing a pack and heading uphill?\u201d Here we are with his mom, Adele and brother, Todd near Mt. Rainier in the \u201870\u2019s.\n\u2014\nPhoto 5: Caring about the environment is in Jay\u2019s DNA. His favorite childhood memories are of exploring the tide pools with his dad, Frank, who taught biology. And now he loves to explore the beach with our grandkids.\n\u2014\nPhoto 6: Here\u2019s Jay with his dad at our son Jack and daughter-in-law Megan\u2019s wedding in 2001. Frank had a great sense of humor. We miss him. - @trudi_inslee"}}]},"shortcode":"BzLlLQOAlTE","edge_media_to_comment":{"count":5},"comments_disabled":false,"taken_at_timestamp":1561569230,"dimensions":{"height":810,"width":1080},"display_url":"https://scontent-lga3-1.cdninstagram.com/vp/c84d4ec4c3f39a35447f65b063096133/5DB6E7FC/t51.2885-15/e35/64269246_148047503009122_8414825207362912627_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","edge_liked_by":{"count":606},"edge_media_preview_like":{"count":606},"location":null,"gating_info":null,"media_preview":null,"owner":{"id":"10361579608","username":"jayinslee"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/ee80be3a881f8ebbcadce95e3cbf18dd/5DA3872D/t51.2885-15/sh0.08/e35/c120.0.720.720/s640x640/64269246_148047503009122_8414825207362912627_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/f7f13220df2c972ce4eb0847c6dca11c/5DB29927/t51.2885-15/e35/c120.0.720.720/s150x150/64269246_148047503009122_8414825207362912627_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":150,"config_height":150},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/400deba1a34716fa0ca6914563ab3767/5DA7A46D/t51.2885-15/
